import {useEffect} from "react";

export default function Order() {

    const orders = () =>{
        fetch("/orders/")
            .then(orders => orders.json())
            .then(orders => console.log(orders))
    }

    useEffect(() => {
        orders()
    }, [])

    return(
        <>
        <div className="order">

        </div>
        </>
    )
}
